import React from "react";

const breadcrumbs = props => {
  return (
    <h4 className="promoCal-brdcrm mb-10">
      {props.module}
      {props.subModules.map(s => {
        return (
          <span key={s} className="font-bold color-blue">
            / {s}
          </span>
        );
      })}
    </h4>
  );
};

export default breadcrumbs;
